#rStudioHeader .menuItems { display: inline-block; }

#rStudioHeader .user { cursor: pointer; font-size: 13px; padding-right: 4px=
; border-radius: 3px; transition-property: opacity, background-color; trans=
ition-duration: 0.25s; }

#rStudioHeader .user:hover { background-color: rgb(249, 248, 248); }

#rStudioHeader .innards { padding: 40px 0px; display: flex; justify-content=
: space-between; align-items: center; transition-property: padding; transit=
ion-duration: 0.5s; }

#rStudioHeader .productLogo { cursor: pointer; }

.padForHeader { padding-top: 130px; }

.shrinkHeader #rStudioHeader .innards { padding: 9px 0px; }

.shrinkHeader .productLogo { height: 30px; width: 144px; }

.shrinkHeader .productLogo.mini { height: 20px; width: 96px; vertical-align=
: middle; }

.headerToggler { right: 10px; top: 10px; z-index: 101; transition-property:=
 top, opacity; transition-duration: 0.25s; position: absolute !important; }

.headerToggler.hidden { top: 55px; background-color: rgb(255, 255, 255); op=
acity: 0.66; border-radius: 0px 0px 5px 5px; box-shadow: rgba(0, 0, 0, 0.1)=
 0px 3px 15px 0px; }

.headerToggler.hidden:hover { opacity: 1; }

.navToggler { left: 10px; top: 10px; position: absolute !important; }

#app.hideHeader #rStudioHeader { top: -55px; }

#app.showAppMessage #rStudioHeader { top: 40px; }

#app.showAppMessage.hideHeader #rStudioHeader { top: -15px; }

@media screen and (max-width: 1023px) {
  #rStudioHeader .productLogo { height: 30px; width: 144px; }
  #rStudioHeader #menuToggler.asNeeded { display: inline-block; }
  #rStudioHeader .menu.main, #rStudioHeader .menu.aux .menuItems { display:=
 none; }
  #rStudioHeader .menu.main.dontCollapse, #rStudioHeader .menu.aux .menuIte=
ms.dontCollapse { display: block; }
  #rStudioHeader .user .userName, #rStudioHeader .user .userNameAccount { d=
isplay: none; }
  #rStudioHeader .innards { padding: 9px 0px; }
  .shrinkHeader #rStudioHeader .menu .menuItem.emphasize { background-color=
: transparent; color: inherit; }
}

@media screen and (max-width: 767px) {
  #rStudioHeader #overlayNavToggler { display: inline-block; }
}

@media screen and (max-width: 600px) {
  .navToggler { left: 0px; }
  .headerToggler { display: none !important; }
}

