.checkboxToggle { height: 0px; opacity: 0; width: 0px !important; margin: 0=
px !important; }

.checkboxToggleLabel { display: inline-block; position: relative; width: 46=
px; height: 28px; cursor: pointer; background-color: rgb(201, 200, 200); bo=
rder-radius: 24px; transition-property: background-color; transition-durati=
on: 0.1s; }

.checkboxToggleLabel:hover { background-color: rgb(193, 192, 192); }

.checkboxToggleLabel::after { content: ""; position: absolute; top: 2px; le=
ft: 2px; width: 24px; height: 24px; border-radius: 24px; background: rgb(25=
5, 255, 255); box-shadow: rgba(0, 0, 0, 0.1) 0px 1px 3px 0px; transition-pr=
operty: left; transition-duration: 0.1s; }

.checkboxToggle:checked + .checkboxToggleLabel { background-color: rgb(170,=
 206, 28); }

.checkboxToggle:checked + .checkboxToggleLabel::after { left: calc(100% - 2=
px); transform: translateX(-100%); }

.checkboxVerticalAdjuster { display: inline-block; margin-bottom: 2px; vert=
ical-align: middle; }

